	private static void write(byte[] content, String fileName) throws IOException {

		FileOutputStream fos = null;
		FileChannel fc_out = null;
		try {
			fos = new FileOutputStream(fileName, true);
			fc_out = fos.getChannel();
			ByteBuffer buf = ByteBuffer.wrap(content);
			buf.put(content);
			buf.flip();
			fc_out.write(buf);
		} catch (IOException e) {
			e.printStackTrace();
		} finally {
			if (null != fc_out) {
				fc_out.close();
			}
			if (null != fos) {
				fos.close();
			}
		}
	}
